var mesh,image,imageAnneau;
var anneau={};
var nImage=0;
var incli=-2.48*Math.PI/180;
var noAxe=false;
var hasSat=true;
var nbEnv=4;
var isDiag=true;
var tEnv=[58000 ,35000,12000,6000];
var tColEnv=["#CCEEEE","#778888","#88AAAA","#AA8888"];
var nbGaz=5;
var tGaz=["H₂","He","CH₄","H₂O","NH₃"];
var tPGaz=[95.5,4,0.2,0.1,0.01];
var distSol=1.43e9;

function avanceImage() {
	nImage++;
	if (nImage>1) {
		geometry = new THREE.SphereGeometry( 180, 32,32 );
		var texture = new THREE.Texture( image );
		texture.needsUpdate = true;
		var textureBump = new THREE.Texture( image );
		textureBump.needsUpdate = true;
		var material2 = new THREE.MeshPhongMaterial({
			//map 
			map: texture,
			castShadow :true,
			receiveShadow :false,
			bumpScale : 4,
			shininess: 3
		  });
	  
		var bufferGeometry = new THREE.BufferGeometry().fromGeometry( geometry);
		mesh = new THREE.Mesh( bufferGeometry, material2 );
		mesh.castShadow = true;
		mesh.rotation.order = "XZY";
		
		scene.add( mesh );
		
		// anneau
		var geomAnneau = new THREE.PlaneBufferGeometry ( 800,800);
		var textureAnneau = new THREE.Texture( imageAnneau );
		textureAnneau.needsUpdate = true;
		var matAnneau = new THREE.MeshPhongMaterial({
			map: textureAnneau,
			transparent: true,
			receiveShadow :true,
			shininess: 8,
			emissive: '#111111',
			side: THREE.DoubleSide
		});
		anneau = new THREE.Mesh( geomAnneau, matAnneau );
	  
		scene.add( anneau );
		
		mesh.rotation.z = incli;
		
		ligneAxe.rotation.z=incli;  

		anneau.rotation.y=incli;
		anneau.rotation.x=Math.PI/2;		
		
		animate();		
	}
}


function init_planete(){
     
	image = document.createElement( 'img' );
	image.onload = function () {
		avanceImage();
	}
	image.src='data:image/jpg;base64,';

	imageAnneau = document.createElement( 'img' );
	imageAnneau.onload = function () {
		avanceImage();
	}
	imageAnneau.src='data:image/png;base64,';
	
}




